import React, { Component } from 'react';


class Dashboard extends Component {
    render() {
        return (
             <div className="container">
        <div className="row">
            <div className="col-md-8">
                <Calendar />
            </div>
            <div className="col-md-4">
                <Chartdata />
            </div> 
        </div>
    </div>
        );
    }
}

export default Dashboard;
